#
# TABLE STRUCTURE FOR: club_table
#

DROP TABLE IF EXISTS `club_table`;

CREATE TABLE `club_table` (
  `clubID` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(40) COLLATE utf8mb4_unicode_ci NOT NULL,
  `catagory` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `bio` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `contact` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `clubPhoto` text COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`clubID`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: membership_table
#

DROP TABLE IF EXISTS `membership_table`;

CREATE TABLE `membership_table` (
  `userID` int(11) NOT NULL,
  `clubID` int(11) NOT NULL,
  `admin` tinyint(1) NOT NULL,
  `memberID` int(11) NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`memberID`),
  KEY `userID` (`userID`),
  KEY `clubID` (`clubID`),
  CONSTRAINT `club_foreignkey` FOREIGN KEY (`clubID`) REFERENCES `club_table` (`clubID`),
  CONSTRAINT `user_foreignkey` FOREIGN KEY (`userID`) REFERENCES `user_table` (`userID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

#
# TABLE STRUCTURE FOR: user_table
#

DROP TABLE IF EXISTS `user_table`;

CREATE TABLE `user_table` (
  `userID` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL,
  `password` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL,
  `fname` varchar(15) COLLATE utf8mb4_unicode_ci NOT NULL,
  `lname` varchar(15) COLLATE utf8mb4_unicode_ci NOT NULL,
  `email` varchar(30) COLLATE utf8mb4_unicode_ci NOT NULL,
  `userPhoto` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `bio` text COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`userID`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



